description:
Pacific Haze - Southern California (Santa Barbara) live touring artist, producing music and experiences across the United States. Organic music for creative minds.

The Medium Times, is our first E.P. release, to be followed up shortly after our indiegogo campaign ends near late May early June.  Recorded in two days in a small Santa Barbara studio (Bluegate Studio), all songs were performed live with vocals dubbed the following day.  Mastered by our friend Dennis at Programmable Soul Audio.
